import React, { useEffect } from 'react';
import Navbar from './Navbar';

const Home = () => {
    return(
        <React.Fragment>
            <Navbar/>
            <div className='container'>
                <div className='my-container'>
                    <h1>Lets fill this world with positivity</h1>
                    <h2>Todays Challenges</h2>
                </div>


            </div>
        </React.Fragment>
    )
}

export default Home;
